import React, { useState, useEffect } from 'react';
import './ViewBookings.css';

const ViewBookings = () => {
  const [bookings, setBookings] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [editingBooking, setEditingBooking] = useState(null); // State for editing

  useEffect(() => {
    const fetchBookings = async () => {
      setIsLoading(true);

      try {
        const response = await fetch('http://localhost:5000/api/bookings');
        if (!response.ok) {
          throw new Error('Failed to fetch bookings.');
        }

        const data = await response.json();
        setBookings(data);
      } catch (error) {
        console.error(error);
      } finally {
        setIsLoading(false);
      }
    };

    fetchBookings();
  }, []);

  // Handle Edit Button Click
  const handleEditClick = (booking) => {
    setEditingBooking(booking);
  };

  // Handle Input Changes in Edit Form
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEditingBooking((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // Handle Form Submission
  const handleFormSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch(
        `http://localhost:5000/api/bookings/${editingBooking._id}`,
        {
          method: 'PUT',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(editingBooking),
        }
      );

      if (!response.ok) {
        throw new Error('Failed to update booking.');
      }

      const updatedBooking = await response.json();

      setBookings((prev) =>
        prev.map((booking) =>
          booking._id === updatedBooking._id ? updatedBooking : booking
        )
      );

      setEditingBooking(null); // Exit edit mode
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="view-bookings">
      <h2>Your Bookings</h2>
      {isLoading ? (
        <p>Loading bookings...</p>
      ) : bookings.length > 0 ? (
        <div className="bookings-list">
          {bookings.map((booking) =>
            editingBooking && editingBooking._id === booking._id ? (
              // Render Edit Form
              <form
                key={booking._id}
                className="booking-card edit-form"
                onSubmit={handleFormSubmit}
              >
                <h3>Edit Booking</h3>
                <input
                  type="text"
                  name="customerName"
                  value={editingBooking.customerName}
                  onChange={handleInputChange}
                  placeholder="Customer Name"
                  required
                />

                <input
                  type="date"
                  name="eventDate"
                  value={editingBooking.eventDate.split('T')[0]}
                  onChange={handleInputChange}
                  required
                />

                <input
                  type="number"
                  name="numberOfGuests"
                  value={editingBooking.numberOfGuests}
                  onChange={handleInputChange}
                  placeholder="Number of Guests"
                  required
                />
                <button type="submit">Save</button>
                <button
                  type="button"
                  onClick={() => setEditingBooking(null)}
                >
                  Cancel
                </button>
              </form>
            ) : (
              // Render Booking Details
              <div key={booking._id} className="booking-card">
                <h3>{booking.venue}</h3>
                <p>
                  <strong>Customer:</strong> {booking.customerName}
                </p>
                <p>
                  <strong>Event Date:</strong> {new Date(
                    booking.eventDate
                  ).toLocaleDateString()}
                </p>
                <p>
                  <strong>Event Type:</strong> {booking.eventType}
                </p>
                <p>
                  <strong>Guests:</strong> {booking.numberOfGuests}
                </p>
                <button onClick={() => handleEditClick(booking)}>Edit</button>
              </div>
            )
          )}
        </div>
      ) : (
        <p>No bookings found.</p>
      )}
    </div>
  );
};

export default ViewBookings;
